import React from 'react';
import Grid from '@material-ui/core/Grid';

const Introduction = () => {
	return (
		<Grid container direction='column' justify='flex-start' alignItems='center'>
			<Grid item>
				<h1 className='heading'>تایپ آنلاین به‌صرفه</h1>
			</Grid>
			<Grid item>
				<h3>تیزتایپ وب‌سایتی برای سفارش و انجام پروژه‌های تایپ بصورت آنلاین می‌باشد.</h3>
			</Grid>
		</Grid>
	);
};

export default Introduction;
